import React from 'react'
import {
  Container,
  Row,
  Col,
  DropdownButton,
  Dropdown,
  Carousel,
  Image,
} from 'react-bootstrap'

const Carousel1 = () => {
  return (
    <div>
      <Carousel
        fade
        style={{
          maxWidth: '1558px',
          height: '400px',
          backgroundColor: 'black',
          marginLeft: 'auto',
          marginRight: 'auto',
        }}
      >
       <img src='../asset/'></img>

      </Carousel>
    </div>
  )
}

export default Carousel1
